import styled from 'styled-components/native';


export const Title = styled.Text`
    font-size: 20px;
    color: #FFF;
    text-align: center;
    margin-top: 8%;
`;

export const SubTitle = styled.Text`
    font-size: 15px;
    color: #FFF;
    text-align: center;
    margin-bottom: 25px;
`;
